XO MAA NU XIJMOJO̱ I NU KUCHTI KJA'NI
XO MAA
Nu ro nde̱ jte̱ ka ro jiegi nu föste i nu jiegi xa'to da nu xijmojo̱ i pe̱ tsi i füdi ka ro mu̱ i ka metsi nu yu kuchti ra
gentho i jingi ne da uni gotho yu mutsi kja'ni;
Nu ro nde̱ jte̱ jingi pädi i jingi ne'ju nu kuchti kja'ni xo kja kosa jingi zoo pa nu yu kja'ni; i xo maa'mu, i ne'ju
ra dté nu kja'ni, bi nka tse xijmojo̱ i i yu kja yu kja'ni, i bi to nu tzu i ni tu'ju bi tze nu ro föste nu ro ña i nu ro
föste i bi tse nu ro mu̱ i;
Nu ro nde̱ jte̱ ra zoo pa nu kuchti yu kja'ni da föchte nu ajte̱ da yu kuchti, pada guani nu zoya jinda maa ra nda
tze̱ di i da bottu yu kja'ni i da maa tzo'ju ko nu manda ajte̱ ;
Nu ro nde̱ jte̱ pa nu da knja i da ye̱ te, da ne ju ra zoo ko yu ra xijmojo̱ i;
Nu ro nde̱ jte̱ nu yo jñini de yu xijmojo̱ i xomaa nu ro je'mi i ne nu yo kuchti de nu nzoya, i ka nzu̱ yu kja'ni i r
aguentho nu kuchti de yu nzoya i nu nana; i xo ma'mu xo zoo i ma'mú nu da te i da te a putze nu ro mu̱ i pa ka
yo kja'ni yo libre;
Nu ro nde̱ jte̱ nu yo jñini ra mütsi xo ma ma'mú i xo nguajuia, xo nföchte ku nu mutsi de yu jñini, nu xijmojo̱ i
i ne i kuchti i fötsi yu yo nzoya;
Nu ro nde̱ jte̱ i juadi yu i bini nu ro kuchti i da jiegui'ju gotho i mporta pa nu ankja nu i da tute ka xo maa;
XO MONTSIJU̱ GOTHO MA'MU NU XO MAA NU XIJMOJO̱ I NU KUCHTI KJA'NI
I ne'ju gotho yu kñi'ni i nu xijmojo̱ i da pa'nu ra'ra, da kuädi nu kja'ni ko nu ajte, i bini'ju teni, i ma'mu, ko nu
ro ujti i nu ro xömpite i nzengua ka kuchti ka, ma'mu, da ma ka ju ra zoo ko yu jñini i gotho nu xijmojo̱ i, nu
pudi i ni i kja nu xijmojoi ni a yu jñi'ni i buni a mu̱ ntsi koyu jñi'ni i ku nu a ajte.
